/* eslint-disable */

function addAvenirNextLTProMediumFont(jsPDFAPI) {
  var font = ''
  var callAddFont = function() {
    this.addFileToVFS('AvenirNextLTProMedium.ttf', font);
    this.addFont('AvenirNextLTProMedium.ttf', 'avenir-medium', 'normal');
  };
  jsPDFAPI.events.push(['addFonts', callAddFont]);
}

export default addAvenirNextLTProMediumFont;
